//SCREAMS INTO PAPER BAG
IT LOOKS SO GOOD OH M YGOD

I mean I know that it's not exactly how it is in the book, but it's not at all less than I expected. It looks pretty amazing to me, and I don't really get why it should be exactly like the book. We're talking about an adaptation here, and as long as it keeps the essence of the book straight, then I can't see what's wrong. Whether the movie differs from the book or not, it's not RUINING it. The book is already done, it exists, and it's great. Why can't the movie exist and be great too in a way that's a bit different from the book? Jeez.
